import React from "react";
import styled from "styled-components";

const Container = styled.div`
  background-color: #f9f9f9;
  padding-bottom: 4rem;

  &::after {
    max-width: 45rem;
    display: grid;
    grid-template-columns: 1fr;
    width: auto;
    margin: auto;
  }
`;

const Footer = () => {
  return <Container>Footer</Container>;
};

export default Footer;
